import { Component } from "react"
import '../assets/css/style.css';
import prod from '../assets/img/prod.jpg';
import grabacion from '../assets/img/grabacion.jpg';
import mix from '../assets/img/mix.jpg';
import master from '../assets/img/master.jpg';
import Servicio from './Servicio';


class Servicios extends Component {





    render() {
        return (
            <div>
                <h1>
                    {servicios.map((iteraServicio, i) => {
                        return (
                            <Servicio 
                            key={i}
                            servicio = {servicio}
                            />
                            );
                        }
                    )}
                </h1>
            </div>
        );
    }
}

export default Servicios;

